import React from 'react';
import { prependOnceListener } from 'cluster';


     let SwitchMarvel = (prop) => {


        prependOnceListener.marvel.dis = this.state.marvel.filter((number) => {
            return number.name.toLowerCase().indexOf('') !== -1;
        });

        return (
        <div className='ctalog' >
            {prop.marvel.map((item) =>
                <div className='catalog1'>
                    <img src={item.image} onClick={()=> prop.handler(item)}></img>

                    <p>{item.name}</p>
                </div>
            )}
        </div>
    )

    };

   /* onClick={()=> props.handler(item)}*/
export default SwitchMarvel;
